// ==UserScript==
// @name         Newgrounds Old Home Page Music
// @namespace    http://tampermonkey.net/
// @version      1.0
// @description  Brings back the old Newgrounds home page music from 2000-2003
// @author       Your Name
// @match        https://www.newgrounds.com/*
// @exclude      https://www.newgrounds.com/game/*
// @exclude      https://www.newgrounds.com/portal/view/*
// @exclude      https://www.newgrounds.com/audio/listen/*
// @grant        none
// @license MIT
// @downloadURL https://update.greasyfork.org/scripts/480080/Newgrounds%20Old%20Home%20Page%20Music.user.js
// @updateURL https://update.greasyfork.org/scripts/480080/Newgrounds%20Old%20Home%20Page%20Music.meta.js
// ==/UserScript==

(function() {
    'use strict';

    // URL of the old home page music
    var musicUrl = 'data:audio/mpeg;base64,';

    // Create an audio element
    var audio = document.createElement('audio');
    audio.setAttribute('src', musicUrl);
    audio.setAttribute('loop', 'loop');
    audio.style.display = 'none';

    // Insert the audio element into the page
    document.body.appendChild(audio);

    // Play the music when the page loads
    audio.play();
})();